Scent of the Day - ARTISAN for Men EDT by @johnvarvatos

Today was supposed to be a short day, so I picked up this fragrance - Artisan from my collection to lighten up this sunny Friday.

Just as the bottle looks, the overtly simple Artisan Original opens up with a very harsh gingerly note but it quickly develops into a fresh, clean and airy scent.

Breaking the ground for the fresh fragrance line for the John Varvatos line, This fragrance does justice to the words ‚ÄúClean & Fresh‚Äù. It smells like a neat, white t-shirt or buttoned down shirt wearing Nigerian man who‚Äôs out for a light day.

Released in 2009 (but still very relevant), It‚Äôs not designed for the heavy-duty, high activity, all-day performance, rather, it‚Äôs performance is skewed towards the short timing, low activity days with light dressing.

The brand recently filled for bankruptcy, so I suggest if you are looking for any of their fragrances, you do that quick...as prices will hike soon and availability will be a huge challenge pretty soon.

P.S. Cheap, Not very long lasting but extremely unique and artistic. Very few perfumes smell like it.

