Had a shocker of a pain day yesterday, so it was a PJs all day kind of day. Even playing a little ACNH was crazy difficult! So I signed up for Disney + and spent the day & night watching some classic Simpsons episodes. The Simpsons are wound up in so many childhood memories for me, that it was actually a really nice way, to spend a really bad day. I picked a stunning outfit out yesterday, but only made it as far as getting some primer in my face. Then I tried to post this photo, but my brain couldn't find the right words. So I stopped pushing myself, relaxed back on the couch with my dogs & watched some more Simpsons. I'm still in a tonne of pain at the moment, but I've moved on to X-Men movies instead of The Simpsons. Hoping to get off the couch and in to something cute at some point. But it's also totally fine if I don't. 
